import React from 'react'
import { Link } from 'react-router-dom';
const cuisines = [
    {
      name: 'Andhra Cuisine',
      link : "/Andhra",
      image: 'data:image/jpeg;base64,',  
      
    },
    {
      name: 'Karnataka Cuisine',
      link : "/Karnataka",
      image : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQvlkFUAGEcNCsiS8ZlaOf6nqWr0S4kcn-Oqg&s', 
    },
    {
      name: 'Kerala Cuisine',
      link : "/Kerala",
      image : 'data:image/jpeg;base64,', 
    },
    {
      name: 'Tamil Nadu Cuisine',
      link : "/TN",
      image: 'data:image/jpeg;base64,', // Replace with your image path
    },
    {
      name: 'Telangana Cuisine',
      link : "/Telangana",
      image: 'data:image/jpeg;base64,', 
    },
    {
      name: 'Udupi Cuisine',
      link : "/Udupi",
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTzppKN7T5REUzgfvrbedaZh2QkulPrIpZoZw&s', 
    },
  ];
  function Cuisine() {
    return (
      <div className="min-h-screen bg-yellow-500 flex flex-col items-center justify-center">
        <h1 className="text-4xl font-bold text-black mb-8">South Indian Cuisines</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {cuisines.map((cuisine, index) => (
            <div key={index} className="flex flex-col items-center">
              <Link to={cuisine.link} className="w-32 h-32 bg-white rounded-full overflow-hidden shadow-lg">
                <img
                  src={cuisine.image}
                  alt={cuisine.name}
                  className="w-full h-full object-cover"
                />
              </Link>
              <h2 className="text-xl font-semibold text-black mt-4">{cuisine.name}</h2>
            </div>
          ))}
        </div>
        <button className="bg-black hover:bg-gray-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline mt-8">
          <Link to='/DishList'>Explore more dishes</Link>
        </button>
      </div>
    );
  }
  export default Cuisine;